{
  id: 'Default (Custom)',
  config: {
    endpoint: 'https://chat.deepseek.com/',
    custom_header: '{
    "Content-Type": "application/json",
    authorization: "Bearer {{api_key}}"
}',
    custom_body: '{
    model: "{{model}}",
    temperature: {{temperature}},
    top_p: {{top_p}},
    frequency_penalty: {{frequency_penalty}},
    presence_penalty: {{presence_penalty}},
    max_tokens: {{max_tokens}},
    n: {{n}},
    stream: {{stream}},
    stop: "{{stop}}",
    messages: {{stringify messages}}
}',
    model: 'deep_seek_r1',
    sanatization_streaming: '// catch error
if (res.status >= 300) {
  const err = data?.error?.message || JSON.stringify(data);
  throw err;
}
let resultTexts = [];
const lines = this.chunk.split("\ndata: ");

const parsedLines = lines
    .map((line) => line.replace(/^data: /, "").trim()) // Remove the "data: " prefix
    .filter((line) => line !== "" && line !== "[DONE]") // Remove empty lines and "[DONE]"
    .map((line) => {
        try {
            return JSON.parse(line)
        } catch { }
    }) // Parse the JSON string
    .filter(Boolean);

for (const parsedLine of parsedLines) {
    const { choices } = parsedLine;
    const { delta } = choices[0];
    const { content } = delta;
    // Update the UI with the new content
    if (content) {
        resultTexts.push(content);
    }
}
return resultTexts.join("");',
    sanatization_response: "// catch error
if (res.status >= 300) {
  const err = data?.error?.message || JSON.stringify(data);
  throw err;
}

// get choices
const choices = (data.choices || data).map(c=> c.message);

// the return object should be in the format of 
// { content: string }[] 
// if there's only one response, put it in the array of choices.
return choices;",
    frequency_penalty: 0,
    presence_penalty: 0.5,
    top_p: 1,
    api_key: '',
  },
}
```

